def parse_function_variables(long_expression: str = EXAMPLE_FUNCTION):
    """
    긴 수식을 받아 sympy로 파싱한 후 정리해서 출력합니다.

    Parameters:
    long_expression (str): 긴 수식 문자열
    """

    # 공백 제거 및 정리
    expression = long_expression.replace("\n", "").strip()

    # 변수 추출 (x_로 시작하는 것들만)
    variables = set(re.findall(r'\bx_\d+_\d+\b', expression))

    # Sympy 기호 정의
    symbols = {v: sp.Symbol(v) for v in variables}

    # 문자열을 수식으로 파싱
    expr_sympy = sp.sympify(expression, locals=symbols)

    # 수식 정리
    simplified_expr = sp.simplify(expr_sympy)

    # 예쁘게 출력
    return simplified_expr
